God’s 🙏🏾Timing ‼️This concludes my Birthday & Anniversary month .The gift that we’ve been patiently waiting on finally came thru, and when we got those words you’re cleared to close, I was so relieved . It’s been a long time coming, 5 months since hurricane Ian displaced us from our home, and I’m grateful for it because we probably would’ve still been staying in someone else place paying rent. Now we are officially Homeowners‼️Thank you God Jesus Christ and the Holy Spirit 🙏🏾this wouldn’t be possible without you.Thank you 🙏🏾😇 to our amazing realtors that assisted us with this process they went over and beyond to help us get in our New home 🏠‼️
#blessings#mainfest#newhome#2023#goals❤️#winning

@selinasellshomes @chelbyrealtor
